import React, { useState } from "react";

const GenreDropdown = (props) => {
  const { topTen, onGenreSelect, artist } = props;
  const [selectedOption, setSelectedOption] = useState("");
  const [topArtist, setTopArtist] = useState("");

  const handleSelectChange = (event) => {
    const selection = event.target.value;
    setSelectedOption(selection);
    onGenreSelect(selection);
    setTopArtist(artist);
  };

  return (
    <div>
      <h2>Your Top 10 genres</h2>
      <select value={selectedOption} onChange={handleSelectChange}>
        <option value="">Select an option</option>
        <option value={topTen[0]}> {topTen[0]} </option>
        <option value={topTen[1]}> {topTen[1]} </option>
        <option value={topTen[2]}> {topTen[2]} </option>
        <option value={topTen[3]}> {topTen[3]} </option>
        <option value={topTen[4]}> {topTen[4]} </option>
        <option value={topTen[5]}> {topTen[5]} </option>
        <option value={topTen[6]}> {topTen[6]} </option>
        <option value={topTen[7]}> {topTen[7]} </option>
        <option value={topTen[8]}> {topTen[8]} </option>
        <option value={topTen[9]}> {topTen[9]} </option>
      </select>

      <p>
        Top {selectedOption} Artist: {topArtist}
      </p>
    </div>
  );
};

export default GenreDropdown;
